import React from 'react';
import './App.css';

function App() {

  const arrayDivs = Array.from(Array(100).keys())
  console.log(arrayDivs)
  return (

    <div className="App">
      {arrayDivs.map((divNumber,index) => <div>{index+1}</div>)}

    </div>
  );
}

export default App;
